import Nav from './Nav';

const Layout = (props, mainTitle, footer) => (
    <div>
        <Nav />
        <h1>{mainTitle}</h1>
        <hr />
        {props.children}
        <hr />
        <h4>{footer}</h4>
    </div>
);

export default Layout;
